import React from "react";
import './Css/style.css';
import objs from "./Data/objs";
import Home from "./Comp/Home";

function App() {
  const links = [
    {text:'Home',id:0},
    {text:'Products',id:1},
    {text:'About',id:2},
    {text:'Contact',id:3}
  ]
  return(
    <Home objs={objs}/>
  )
}

export default App;
